import React from "react";

const Attractions=(props)=>{
    console.log('hotels',props.attractions)
    const filtered=props.attractions.filter((place)=>{
        return place.photo&&place.name&&place.subtype[0]
    })
    const display=filtered.map((place)=>{
        return(
            <div style={{width:400}}className="card">
                <div className="card-content">
                    <h1>{place.name}</h1>
                </div>
                <div className="content align">
                    <div className="card-image">
                        <img src={place.photo.images.thumbnail.url}></img>
                    </div>
                    <div className="align">
                        <div>
                            <p>Rating:{Math.floor(parseFloat(place.rating)*10)/10}</p>
                            <p>Cuisine:{place.cuisine[0].name}</p>
                            <p>Price:{place.price_level}</p>
                        </div>
                        <div>
                            {place.district?<p>Neighborhood:{place.neighborhood_info.name}</p>:<p></p>}
                            <a href={place.web_url} target="new"><i class="fa-solid fa-globe"></i></a>
                        </div>
                    </div>
                </div>
            </div>
        )
    })

}

export default Attractions
